// MA计算公式
function calculateMA(dayCount, datas, times) {
    var result = []
    for (var i = 0, len = times.length; i < len; i++) {
        if (i < dayCount) {
            result.push('-')
            continue
        }
        var sum = 0
        for (var j = 0; j < dayCount; j++) {
            sum += datas[i - j][1]
        }
        result.push((sum / dayCount).toFixed(2))
    }
    return result
}

function getOneYearAgoByLastOneDay() {
    const c = times.length
    if (c > 365) {
        return times[c - 100]
    }
    return times[0]
}



